import React from 'react';


function Footer(props) {

  var date = new Date().getFullYear();


  return(

    <>
    <footer>
        <section  class="footer-area py-2">
            <div class="container">
                <div class="row">
                    <div class="w-100"></div>
                    <div class="col-md-12 pt-4 ">
                       <p class="text-muted">&copy; {date} - All Rights Reserved - RD Telinet Pvt Ltd<br/><small><a href="https://wittyweb.in" class="text-muted" target="_blank" rel="noopener noreferrer">Website Designed by Witty Web Solutions</a></small></p>
                    </div>
                </div>
            </div>
          </section>
    </footer>
    </>

  );

}

export default Footer;
